			function startCounter() {
				if ($(window).scrollTop() > 200) {
					$(window).off("scroll", startCounter);
					$('.rating-count').each(function() {
						var $this = $(this);
						jQuery({
							Counter: 0
						}).animate({
							Counter: $this.text()
						}, {
							duration: 4000,
							easing: 'swing',
							step: function() {
								if (isFloat($this.data('counter'))) {
									$this.text(Number.parseFloat(this.Counter).toFixed(
										1) /*Math.ceil(this.Counter)*/ );
								} else {
									$this.text(Math.ceil(this.Counter));
								}
